To determine the formal sources of international law, we need to consider the established principles and conventions recognized in international legal theory and practice.

1. **Treaties**: These are formal agreements between states, often referred to as conventions, protocols, or pacts. They are a primary source of international law.

2. **Custom**: Customary international law is derived from the consistent practice of states, accompanied by the belief that such practice is required by law (opinio juris).

3. **General Principles of Law**: These are principles that are recognized by the major legal systems of the world and are considered to be part of international law.

The Statute of the International Court of Justice (ICJ), which is the principal judicial organ of the United Nations, lists these three sources in Article 38(1). The relevant part of the article states:

"1. The Court, whose function is to decide in accordance with international law such disputes as are submitted to it, shall apply:
   a. international conventions, whether general or particular, establishing rules expressly recognized by the contesting states;
   b. international custom, as evidence of a general practice accepted as law;
   c. the general principles of law recognized by civilized nations;
   d. subject to the provisions of Article 59, judicial decisions and the teachings of the most highly qualified publicists of the various nations, as subsidiary means for the determination of rules of law."

